sourcesContent:
import express from "express";
import { selectSql, createSql } from "../database/sql";

const router = express.Router();

//    (GET)
router.get("/reservation", async (req, res) => {
    if (!req.session.user || req.session.user.role !== "Customer") {
        return res.redirect("/"); //  
    }

    const userEmail = req.session.user.id;

    try {
        const reservations = await selectSql.getReservationsByEmail(userEmail);
        res.render("reservation", {
            title: "My Reservations",
            reservations,
        });
    } catch (error) {
        console.error("Error fetching reservations:", error);
        res.status(500).send("Error fetching reservations.");
    }
});

//   (POST)
router.post("/reservation", async (req, res) => {
    const { bookId } = req.body;

    //      
    const userEmail = req.session.user.id;

    if (!userEmail) {
        return res.json({ success: false, message: "User not logged in." });
    }

    try {
        await createSql.addReservation({ userEmail, bookId });
        res.json({ success: true });
    } catch (error) {
        console.error("Error creating reservation:", error);
        res.json({ success: false, message: "Failed to create reservation." });
    }
});

export default router;

